import './App.css';
import Recipes from '../recipes/Recipes.js'
import {recipes} from '../recipes/Recipe-data.js'
import Header from '../header/Header.js'

function App() { 
    return(
    <div>
        <Header title="Recipes"/>
        <Recipes/>
        <div>
                    {recipes.map((index)=>(
                        <Recipes
                        key={index} 
                        data={index}/>
                    ))}
                </div>
    </div>
    ); 
}

export default App;
